import React from 'react';
const Pagination = (pops) => {
    return (
        <nav aria-label="...">
        <ul class="pagination">
            <li class="page-item disabled">
            <a class="page-link" tabindex="-1" aria-disabled="true">Previous</a>
             </li>
        </ul>
        </nav>
    );
}

export default Pagination;
